import "./style.css";
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import {
    BrowserRouter as Router,Routes,Route
  } from "react-router-dom";

import { useState } from "react";
import Homepage from "./components/homepage";
import Loginpage from "./components/loginpage";
import { Register } from "./components/loginpage";
import Main from "./components/main";
import axios from "axios";
import Ei from './components/sample'
import Votehere from "./components/votehere";
import { Vote } from "./components/votehere";
import Admin from "./components/admin";
import Adminloginpage from "./components/adminlogin";
import { Admincand } from "./components/admin";
import Rescand from "./components/candres";
import Insertdata from "./components/insert";
import Otptest from "./components/otptest";
import { useNavigate } from "react-router";

function Logout(){
   let lg=useNavigate()

   localStorage.removeItem('auth');
   localStorage.removeItem('token');
   localStorage.removeItem('name');
   localStorage.removeItem('cid');
   localStorage.removeItem('bts')
   localStorage.removeItem('namev')
   localStorage.removeItem('des')
   localStorage.removeItem('btstat')
   localStorage.removeItem('usid')
   localStorage.removeItem('aid')
   localStorage.removeItem('atime')
   localStorage.removeItem('aposid')
   localStorage.removeItem('adminauth')
   localStorage.removeItem('adauth')
   localStorage.removeItem('time')
   lg('/');
 return(
   <div><Homepage /></div>
 );
}

function Alogout(){
   let lg=useNavigate()
setadminaut(false);
localStorage.removeItem('aid')
 return(
   <div><Homepage /></div>
 );
}

export default function App() {



   const [aut, setaut] = useState(false)
   const [adminaut, setadminaut] = useState(false);

   axios.get("http://localhost:8000/reg/isUserAuth", {
      headers:{"x-access-token": localStorage.getItem("token") }, }).then((res)=>{
                     if(res.data.m==='ok'){
                        setaut(localStorage.getItem('auth'))
                        setadminaut(localStorage.getItem('adauth'))
                     }
                     else{}
      });
    return(
     <Router>
        <Routes>
           <Route path="/" element={<Homepage />} ></Route>
           <Route path="/enter" element={adminaut?<Insertdata />:<Alogout />} ></Route>
           <Route path='/login' element={<Loginpage />} ></Route>
           <Route path='/admin' element={< Adminloginpage />} ></Route>
           <Route path='/sign' element={<Register />}></Route>
           <Route path='/sample' element={<Ei />}></Route>
          <Route path="/main" element={aut ?<Main card={<Ei />} page='Home'  home='/main' votehere='/votehere' />:<Logout />}></Route> 
          <Route path="/votehere" element={aut ?<Votehere /> :<Logout />}></Route>   
          <Route path="/Vote/:id" element={aut ?<Vote  />:<Logout />}></Route> 
          <Route path="/pro/" element={adminaut?<Admin />:<Alogout /> }></Route>
          <Route path="/Avote/:id" element={adminaut?<Admincand />:<Alogout /> }></Route>
          <Route path="/Candres/:id" element={adminaut?<Rescand />:<Alogout /> }></Route>

        </Routes>
     </Router>
    ); }
